$.cB=function(){var s=t.i
return H.b([H.b(["Food Donation","communityfood.png","comfood2.png","comfood3.png","Community Food","Food insecurity is an issue that affects 1 in 8 Americans. Due to this many food banks are often struggling with food collection and distribution. To make matters more difficult, many of these individuals do not qualify for federal nutrition programs currently and thus rely heavily on their local food banks. This is all happening in a country where 30-40 percent of food goes to waste.  A large portion of this waste is simply due to the food being \u201cugly.\u201d This ranges from dents in cans to off-color tomatoes. These items, along with those after the suggested sell-by date, are often still safe to donate, yet aren\u2019t donated.\n\nA group of college students and I developed the Community Food app so together with restaurants, grocers, and food banks we can connect people to better food. Our app makes listing donations and scheduling food pickups as easy as a few taps.\n\nOur team had gone out and looked into reasons restaurants and grocers are not donating food and came up with the following three main reasons.\n\n    1. Lack of Education. Many workers do not know about their local food resources and do not know how to responsibly donate.\n\n    2. Hassle/Lack of Time. Often it is just seen as too hard to list all the items and contact the local food resource. There is a lot going on in a kitchen/supply room and donation is not seen as a priority.\n\n    3. Assumption the Food is Not Wanted. This is similar to the lack of education but is based around the idea that the food will not be good enough for the food resource and thus is better in the trash.\n\nOne of the big things we found when conducting our research was that no one said they don\u2019t donate because they have nothing to give or no one to give it to; they simply just did not know what to give or who would be best to give it to.\n\nWe aimed to help solve the issue of food insecurity and food waste in one elegant solution. Education and automation of the food donation/receiving process will help us tackle these issues head-on.","Our team realized that the gap between the 40% of food going to waste and the 1 in 8 food-insecure Americans was not a supply problem but a data problem. We started looking at how we could help automate the food donation and collection process to encourage donations while at the same time educating the public. This was the founding idea for the Community Food app.\n\nLooking at the current donation process you are expected to search for your local food resource, give them a call, and then wait to describe your possible donation to an overworked volunteer. It is not an easy or rewarding process and poor descriptions can lead to time wasted.\n\nAs a donor, all one would have to do is download the app, register their location, and start scanning barcodes of items ready to be sent to food services, along with a brief description. At this point, the volunteers at the local food services will be alerted on their phones that there is food ready to be retrieved. They will get information on what the food is, it\u2019s nutritional content, how large it is, and if it is perishable. This will allow them to make educated decisions on how much room they need, how many volunteers should go out, and if they need to bring a refrigeration unit. This will help keep food from going bad as well as save the time of overworked volunteers.\n\nThis application takes advantage of the fact that most people have a smartphone with access to the internet, GPS, and a camera on them at all times. We take the average smartphone and turn it into a network of data collections devices in the fight against hunger.\n\nCommunity Food takes away the need to know who and where you are donating to. It removes the hassle of logging and communication, and most importantly shares exact nutrients and sizing information with the volunteers picking it up. This makes everyone\u2019s lives easier in the food donation and collection process.","Scanning a barcode in the app","Picking up a donation in the app"],s),H.b(["Finding Free Food","campusfood.png","campusfood3.png","campusfood2.png","Campus Food","Way in the back of the campus at the Rochester Institute of Technology is a beige paneled building. Most of the space on the ground floor is taken up by a laundry room, but next to that is a FoodShare. This is a place students in need can pick up donated groceries and other essentials donated from the local community.\n\nFor the first 2 years of college I thought nothing of it until a friend mentioned to me that it had well over 8000 student visits. For a private college with clubs giving away free food and vendors offering samples I always took food for granted. This was clearly not the case for everyone.\n\nI started Campus Food as a Twitter retweet bot and a way to start learning Python. It would search for tweets mentioning free food at RIT and retweet them to the @RITFreeFood account for my followers. After setting it up I quickly forgot about it, thinking little of the efforts so far. A year later I revisited it and noticed the well over 500 followers and the many missed messages. Who would have thought college students love free food.\n\nI realized there may be some potential to this idea. Many of the messages were about bringing this to another form besides Twitter as the platform was quickly losing popularity on campus. I started work on an RITFreeFood website where students could view a live map of free food powered by location keywords in the tweets. From there I added a method for students to submit new events directly to the service. This is when I had a few brands reach out to me wanting to promote their products.","I decided to make the pivot from a fairly basic webpage to a mobile application. This was due in large point from not knowing how to properly store my API keys in JavaScript. I wrote and released a mobile application, now called Campus Food, on iOS and Android. This quickly  minor popularity on campus.\n\nMy goal from there was to implement ads and start working with brands doing events on campus to promote their giveaways in order to start making revenue. I recruited a small team of students to grew this idea with me.\n\nThe next semester we launched a crowdfunding campaign to scale our app to new campuses. Currently, the app is functional on over 800 campuses in the United States, helping hungry people find free food, and reducing food waste.","The login screen of the app","An example of a post on the app"],s),H.b(["Eyeglass Buying","form.png","fe2.png","fe3.png","Form Eyewear","TODO","TODO","TODO","TODO"],s),H.b(["Thermoses","rise.png","notfound.jpg","notfound.jpg","Rise Thermos","TODO","TODO","TODO","TODO"],s),H.b(["Learning Electronics","paperbread.png","pb2.png","pb3.png","Paper Breadboarding","A common problem I believe in is that technology is advancing far faster than our education system. Teachers, though experienced in many fields, are continuously asked to prepare modern lessons without the support for the appropriate budget or time to learn themselves. For this reason, many modern engineering subjects are simply unable to be taught outside of a specialized environment. I was lucky enough to go to a high school that did offer these specialized engineering environments and I wanted to bring this modern opportunity to the general population.\n\nIf we brought down the cost of materials and the learning curve for the instructor this could eliminate most of the barriers to entry for this critical education. Currently, for $60 an instructor can demo basic electronics and circuitry lessons to a class. This is the cost of one kit, a kit that only one individual can interact with at a time. For this project I wanted to offer that same learning experience to an entire class at the same time, all while not costing any more.\n\nMy solution to this problem was paper. Probably the most common classroom material.","Paper Bread was an interactive online circuit maker where teachers could build their own, or download pre-built lesson plans, for circuits. The circuit components listed in the lesson plans were real prototyping components such as breadboards, LEDs, SMD resistors, and various sensors. Most lesson plans had a cost per student of $2 ($60 for a class of 30 \ud83c\udf89) and included links to purchase the components wholesale.\n\nLessons plans were printed and placed on top of each breadboard. The students would then be instructed to punch each component through the paper and into the breadboard to complete the circuit. This design resembled how the Lite-Brite toy worked.\n\nI tested this project at Imagine RIT and two Maker Faires, helping people from 8 to 80 years old make their first circuit. The look of excitement when they lit up their first LED or connected their first sensor was like they had just performed magic. In under 10 minutes, they went from a printed sheet of paper on a plastic box to controlling electricity using real electronics.\n\nI am currently working on making a more stable version of this project and testing it in more classrooms. If you are interested in testing it out or finding out more please feel free to reach out to me: McCossum@gmail.com","A Parer Bread kit cut out","A young student using Paper Bread"],s),H.b(["Maintenance Requests","ua3.png","upkeepalert.png","ua2.png","Upkeep Alert","Finding new applications for existing products is just as important to the entrepreneurial mindset as creating a new product. Doing this not only provides new value to an existing product but greatly reduces the expensive development time. This is the approach I took with many of the applications in my portfolio.\n\nIt started simply, developing Campus Food in order to help the many hungry college students locate free food. To develop this application I had to create a system to aggregate and display live, crowdsourced, geolocation data. It served a much more friendly utility, but in short, that is all it was. After running the service for a few months a local food bank reached out to me thinking they were the intended audience. After taking the lesson to better brand my application I realized that they were not wrong, there was nothing preventing them from being the customer of a food geolocation aggregation service. My team and I quickly threw a new skin on the application and rebranded that fork as Community Food for them.\n\nThe move to create Campus Food took months but the transition to Community Food only took a few weeks. At this point, it had become easier to develop new applications for new markets over trying to add more and more complex features to obtain a niche market. The team I was working with at the time split into half working on new markets and the other half maintaining and marketing the already developed apps. This is when we created Upkeep Alert.\n\nMoving from community-centered food information into facilities management systems was not an immediately apparent decision. The team took a long look at what location data we could crowdsource. I remember being on my way to a college exam and needing to quickly use the restroom. The sink in the restroom was stuck on and overflowing, wasting a ton of water and damaging the area. I did nothing about this, my exam was more important to me than taking time to call maintenance. Due to not having a system to quickly send urgent maintenance requests the expenses from these events piled up. This is where the idea for Upkeep Alert came from.","The current for maintenance reporting was to observe a maintenance issue, go find a computer, log in to an online portal, and try to describe an issue you are no longer even keeping an eye on. By using the same system as with the other applications all anyone would have to do moving forward is take a picture on their phone and provide an optional description and the geolocation data would be sent right to maintenance. The multi-step process was reduced to just 2 quick actions.\n\nDue to the criticality of the data being captured by the app, my team created a unique strategy of rolling out changes. We would test new features in Campus Food, an app that if it failed a few college students may miss out on a free food event. From there we tested them in a more critical application, Community Food. If all went well we would finally roll out the changes to Upkeep Alert, keeping our potential enterprise customers on the most stable and tested application.\n\nWe look to one day pick up this application\u2019s development again and integrate its simple reporting system into other commonly used maintenance management applications.","Marking a maintenance issue on the app (old)","Providing more information on a maintenance issue"],s),H.b(["Infamy","nofame.png","nofame.png","nofame.png","NoFame","TODO","TODO","TODO","TODO"],s),H.b(["Disability Design Thinking","dfd.png","ih2.png","ih3.png","Design For Diversity","During my second year of college, I was asked the question \u201cWhat are our shortcomings when it comes to innovation?\u201d I had recently started leading the Innovator\u2019s Hour research organization through the Albert J. Simone Center for Innovation and Entrepreneurship which gave my team the unique opportunity to create programs to help address these shortcomings.\n\nA few select members of the research organization and I realized that most of the entrepreneurial ideas coming from the club were targeted towards what we then called the \u201ciPhone Demographic.\u201d A largely upper-middle-class demographic that tended to be thought of as whiter, predominantly male, able-bodied individuals. There are many reasons for selecting this demographic when doing case studies for new products and services, but it ignores an immense portion of society.\n\nOn behalf of the club, I reached out to a number of diversity, inclusion, and belonging groups on the RIT campus. We ended up partnering with Grey Matter, a hot-button discussion group, along with the Center for Diversity and the college\u2019s President\u2019s office to plan a weekend-long event named \u201cDesign for Diversity.\u201d\n\nDesign for Diversity challenged the students to design a product or service serving underrepresented groups. Teams of students were assigned pre-written user stories focusing on the lives of immigrants, specially-abled individuals, and various minority populations.","From there the teams looked at what popular modern products were not serving these demographics and identify why. The list the teams came up with was even larger than I expected.\n\nThe teams were then given the next 24 hours to reimagine popular products to better fit the needs of their given user story. Innovator\u2019s Hour had a number of faculty moderators going between the teams to make sure topics stayed respectful, appropriate, and avoiding making any negative assumptions of their given demographics. Many of the mentors were able to even pull in people closely fitting the user stories in order to get real market research.\n\nAt the end of the weekend, the teams came together to present their work in front of the group. Though none of these ideas ever came to market the goal of this event was still made. It was never our intention to sell a new product or service from this weekend but instead, get students thinking outside the illegitimate box of what a \u201cnormal\u201d end-user is. We hope this activity inspired more diverse work in the RIT entrepreneurship community moving forward.","Students brainstorming","Students presenting their final project"],s),H.b(["Low-Mobility Dexterity","hand.png","notfound.jpg","notfound.jpg","Joe","TODO","TODO","TODO","TODO"],s),H.b(["Bike Racks","rack.png","rack.png","rack2.png","Hidden Bike Racks","TODO","TODO","TODO","TODO"],s),H.b(["Hearing","wavio1.png","wavio3.png","wavio2.png","Wavio","TODO","TODO","TODO","TODO"],s),H.b(["Picking Where to Eat","rm.png","notfound.jpg","notfound.jpg","Restaurant Match","TODO","TODO","TODO","TODO"],s)],H.a5("r<q<l*>*>"))}()
